import React, { useEffect } from 'react'

function App() {
  useEffect(() => {
    fetch('https://jsonmock.hackerrank.com/datetime')
      .then(res => res.json())
      .then(data => console.log(data.date))
  }, [])
  return (
    <div className="App">
    </div>
  );
}

export default App;

